  //   width: 3,
  //   height: 4
  // },
  // {
  //   src: "https://source.unsplash.com/NQSWvyVRIJk/800x599",
  //   width: 4,
  //   height: 3
  // },
  // {
  //   src: "https://source.unsplash.com/zh7GEuORbUw/600x799",
  //   width: 3,
  //   height: 4
  // },
  // {
  //   src: "https://source.unsplash.com/PpOHJezOalU/800x599",
  //   width: 4,
  //   height: 3
  // },
  // {
  //   src: "https://source.unsplash.com/I1ASdgphUH4/800x599",
  //   width: 4,
  //   height: 3
  // }];
  const height = 300;

  return (
    <div class="misc" id="misc">
      <div className="background2" />

      <Typography variant="h3" className="center1">
        <Slide left>PHOTOS</Slide>
        <Slide left>
          <div className="subhead" />
        </Slide>

      </Typography>
      <div className="misccontainer">
        {/* <Fade delay="200">
            <Slide bottom>
              <GridList cellHeight={height} className="overflow" cols={5}>
                {img.map(tile => (
                  <GridListTile key={tile.img} cols={tile.cols || 1}>
                    <div className="picture">
                      <div className="picture3">
                        <a className="none2" href={tile.img} target="_blank">
                          <div className="download">VIEW</div>
                        </a>
                      </div>
                      <img
                        src={tile.img}
                        alt={tile.title}
                        className="picture2"
                      />
                    </div>
                  </GridListTile>
                ))}
              </GridList>
            </Slide>
          </Fade> */}
        <div>
          <Gallery photos={src} onClick={openLightbox} />
          <ModalGateway>
            {viewerIsOpen ? (
              <Modal onClose={closeLightbox}>
                <Carousel
                  currentIndex={currentImage}
                  views={src.map(x => ({
                    ...x,
                    srcset: x.srcSet,
                    caption: x.title
                  }))}
                />
              </Modal>
            ) : null}
          </ModalGateway>
        </div>


      </div>
    </div>
    // </div>
  );

}
export default Misc;
